import React, { Component } from 'react';
import Todos from './components/Todos';
import {Button, Typography, Drawer} from '@material-ui/core'


import './App.css';

class App extends Component {

  state = {
    todos: [
      {
        id: 0,
        title: 'Take out the trash',
        checked: false
      },
      {
        id: 1,
        title: 'Yankee with no brim',
        checked: false
      },
      {
        id: 2,
        title: 'Based on what?',
        checked: false
      }
    ]
  }

  render() {
    return (
        <div className='App'>
            <h1>Todo</h1>
        </div>
    );
  }
}

export default App;
